//	1  |  b
//
// and rightGroups = [{startIdx: 0, endIdx: 2, numRepeats: 3}]
// then buildRightGroups expands this to
//
//	R1 |  R2
//	--------
//	1  |  a
//	1  |  b
//	1  |  a
//	1  |  b
//	1  |  a
//	1  |  b
